import React, { Component } from 'react';
import './Headline.css';
import logo from './logo.png';

const Menu = (props) => {
    let linksMarkUp = this.props.links.map((link, index) => {
      return(
        <li className = "menu-item col-md-3"><a href={link.link}>{link.label} </a></li>
      );      
    });   //pobieranie listy links z app.js
    return(
      <nav className = "col-12">
        <div className = "menu row">
          <div className = "col-md-2">
            <img src= {logo} alt = "DKF Politechnika" className = "logo"/>
          </div>
          <div className = "border col-8 offset-2">
            <ul className = "menu-list col-md-10 offset-md-1">
              {linksMarkUp}
            </ul>
          </div> 
        </div>  
      </nav>
    );

}

export default Menu;
